import React from "react";
import { Typewriter } from "react-simple-typewriter";

export default function Profile() {
  const MyComponent = () => {
    const handleType = (count: number) => {
      // access word count number
      console.log(count);
    };
  };

  const handleDone = () => {
    console.log(`Done after 5 loops!`);

    return (
      <div className="profile-container">
        <div className="profile-parent">
          <div className="profile-details">
            <div className="profile-colz">
              <a href="https://www.facebook.com/stamatis.giovanis/">
                <i className="fa fa-facebook-square"></i>
              </a>
              <a href="https://www.linkedin.com/in/stamatis-giovanis-b149b2223/">
                <i className="fa fa-linkedin-square"></i>
              </a>
              <a href="https://www.instagram.com/stam_gio_/">
                <i className="fa fa-instagram"></i>
              </a>
              <a href="https://github.com/StamGio">
                <i className="fa fa-github-square"></i>
              </a>
              <a href="https://twitter.com/StamatisGio">
                <i className="fa fa-twitter"></i>
              </a>
            </div>

            <div className="profile-details-name">
              <span className="primary-text">
                {" "}
                Hello, I'M <span className="highlighted-text">Stamatis</span>
              </span>
            </div>
            <div className="profile-details-role">
              <span className="primary-text">
                {" "}
                <h1>
                  <Typewriter
                    words={[
                      "Full Stack Developer",
                      "Enthusiastic New Dev",
                      "Cross Platforms",
                      "Blochchain Rookie Developer",
                    ]}
                    loop={Infinity}
                    cursor
                    cursorStyle="_"
                    typeSpeed={70}
                    deleteSpeed={100}
                    delaySpeed={2000}
                    onLoopDone={handleDone}
                    onType={handleType}
                  />
                </h1>
              </span>
            </div>
          </div>
        </div>
      </div>
    );
  };
}
